components/amp/styles/footer:
.amp-footer {
  border-top: 1px solid {{color_borders}};
}

.amp-footer-heading {
  color: {{color_headings}};
}

.footer-social {
  text-align: left;
  padding-bottom: 30px;
  margin-bottom: 15px;
  border-bottom: 1px solid {{color_borders}};
}

.footer-social-media {
  list-style: none;
  margin-left: 0;
}

.social-media-link {
  display: inline-block;
  margin-right: 25px;
}

.social-media-link svg {
  fill: {{color_text}};
}
